import { Route, Routes } from 'react-router-dom';
import './assets/estilos/App.css'
import { Carrusel } from './componentes/Carrusel';
import { Footer } from './componentes/Footer';
import { Header } from './componentes/Header';
import { Provider } from './context/context';
import { Carrito, HomePage, NotFoundPage, Formulary } from './Pages/index';
import { Toaster } from 'react-hot-toast';
import { useProducts } from './context/context';

function App() {
  const { setOpenCar, openCar } = useProducts()
  return (
    <>
    <Provider>
      <Header></Header>
      <Carrusel></Carrusel>
      <Routes>
        <Route index element={<Carrito setOpenCar={setOpenCar} openCar={openCar}></Carrito>}></Route>
        <Route path='/inicio' element={<Carrito></Carrito>}></Route>
        <Route path='/backend' element={<HomePage></HomePage>}></Route>
        <Route path='/backend/new' element={<Formulary></Formulary>}></Route>
        <Route path='*' element={<NotFoundPage></NotFoundPage>}></Route>
      </Routes>
      <Toaster></Toaster>
      <Footer></Footer>
    </Provider>
    </>
  );
}

export default App;
